import React from "react";

const AdminDashboard = ({ username }) => {
  return (
    <div style={{ padding: "20px" }}>
      <h1>Welcome, {username}!</h1>
      <p>This is the admin dashboard.</p>
    </div>
  );
};

export default AdminDashboard;
